  ["knowinger"] = "<html><body><h1>knowinger</h1><p>vt.<p></p>know的变形<p></p>adj.<p></p>有知识的，有学问的；有见识的<p></p>知道的，通晓的；消息灵通的<p></p>有洞察力的<p></p>聪明的；精明的；机敏的<p></p>会意的，心照不宣的<p></p>故意的，蓄意的，成心的<p></p>[贬义]世故的；狡猾的；老练的<p></p>自以为无所不知的<p></p>[口语]漂亮的，时髦的<p></p>n.<p></p>知道，知晓，认识<p></p>短语:<p></p>be knowing in<p></p>擅长于；精通<p></p>know<p></p>[nəu]<p></p>vt.<p></p>知道，了解，懂得，通晓，掌握…的知识(或技能)：<p></p>Does he know English?<p></p>他懂英语吗?<p></p>I know the facts.<p></p>我了解事实情况。<p></p>He knows how to play chess.<p></p>他会下棋。<p></p>确知，确信，确认：<p></p>I know that he's a good man.<p></p>我确信他是个好人。<p></p>认识；相识，结识：<p></p>I never know such a man.<p></p>我从不认识这样一个人。<p></p>He knows my brother.<p></p>他认识我弟弟。<p></p>I know of him, but I do not know him personally.<p></p>我听说过他，但我并不认识他。<p></p>记得，牢记，熟记，背熟：<p></p>I know an old song about love.<p></p>我记得一首关于爱情的老歌。<p></p>The actor knows his lines by heart.<p></p>那位演员能够背诵自己的台词。<p></p>认出，辨认出：<p></p>I knew him for a Frenchman.<p></p>我认出他是一名法国人。<p></p>I knew him at once.<p></p>我立即认出了他。<p></p>分辨，识别：<p></p>You should know right from wrong.<p></p>你应当明辨是非。<p></p>见到过；听到过[一般用于过去时或完成时]：<p></p>I've never known him to cry.<p></p>我从未见过他哭泣。<p></p>I never knew anyone who could walk on his head.<p></p>我从未听说过有人能倒立着走路。<p></p>对…有研究，精通：<p></p>He knows literature.<p></p>他对文学很有研究。<p></p>经历，经受，体验：<p></p>He has known better days.<p></p>他曾过过好日子。<p></p>He knew poverty and sorrow.<p></p>他经历过穷苦日子。<p></p>受…支配(或影响)：<p></p>His wrath knew no bounds.<p></p>他怒不可遏。<p></p>[古语]与…性交，与…发生性关系<p></p>vi.<p></p>知道，了解，懂得，确知，知情：<p></p>知道，了解，懂得，确知，知情：<p></p>I'm not guessing, I really know.<p></p>我不是在猜测，我真的知道。<p></p>I know of its being so.<p></p>我知道是这样的。<p></p>n.<p></p>[口语]知道，知晓，知情[主要用于习语]<p></p>短语:<p></p>all one knows<p></p>[口语]<p></p>全部力量，力所能及的一切<p></p>竭尽全力地，尽可能地<p></p>before one knows where one is<p></p>[口语]转瞬之间，极快地<p></p>don't I know it<p></p>[口语]我何尝不知道[表示无可奈何的认可]<p></p>don't you know<p></p>[口语][用作插入语]你也知道；你是知道的，不是吗?<p></p>Do you know something?<p></p>让我告诉你，听我说；要不要我把真相告诉你?<p></p>for all someone knows<p></p>[口语]<p